  `created_by_pilote_id` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id_company`),
  UNIQUE KEY `email` (`email`),
  KEY `idx_company_creator` (`created_by_pilote_id`),
  CONSTRAINT `fk_company_creator` FOREIGN KEY (`created_by_pilote_id`) REFERENCES `pilote` (`id_pilote`) ON DELETE SET NULL ON UPDATE CASCADE
