DROP TABLE IF EXISTS `student`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8mb4 */;
CREATE TABLE `student` (
  `id_student` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `password` text NOT NULL,
  `location` text DEFAULT NULL,
  `phone_number` varchar(20) DEFAULT NULL,
  `date_of_birth` date NOT NULL,
  `year` enum('1st','2nd','3rd','4th','5th') NOT NULL,
  `description` text DEFAULT NULL,
  `school` varchar(255) DEFAULT NULL COMMENT 'Name of the student school, set by admin/pilote',
  `profile_picture` longblob DEFAULT NULL COMMENT 'Binary data of the profile picture',
  `profile_picture_mime` varchar(50) DEFAULT NULL COMMENT 'MIME type of the profile picture (e.g., image/jpeg)',
  `created_at` timestamp NULL DEFAULT current_timestamp(),
  `updated_at` timestamp NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `created_by_pilote_id` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id_student`),
  UNIQUE KEY `email` (`email`),
  KEY `idx_student_creator` (`created_by_pilote_id`),
  CONSTRAINT `fk_student_creator` FOREIGN KEY (`created_by_pilote_id`) REFERENCES `pilote` (`id_pilote`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_uca1400_ai_ci;
